import React, { useMemo, useState } from 'react'
import './style.css'
import Club from './one'

const Clubs = () => {
  const clubs = useMemo(() => Array.from(
    { length: 5 },
    (_, index) => ({
      active: index == 2,
      title: "Community Club",
      content: 'Join the motivated club to improve your communication skills'
    })
  ), [])
  console.log(clubs)
  return (
    <section className='cards_list'>
      {
        clubs.map(one => (
          <div>
            <Club title="Community Club" content='Join the motivated club to improve your communication skills' />
          </div>
        ))
      }
      <div className='active'>
        <Club active title="Community Club" content='Join the motivated club to improve your communication skills' />
      </div>
      <div>
        <Club />
      </div>
    </section>
  )
}

export default Clubs
